import axios from 'axios';
import { useState, useEffect } from 'react';

function Results() {
  const [isLoading, setIsLoading] = useState(false);
  const [metrics, setMetrics] = useState([]);

  // figure out why api call is getting a 404 error
  // probably because it doesn't know th URL prefix

  useEffect(async () => {
    try {
      setIsLoading(true);
      const { data } = await axios.post('/api/airbnb', {
        url: 'airbnb.com/abc',
      });
      console.log(data);
      setMetrics(data);
    } catch (error) {
      console.error(error);
    }
    setIsLoading(false);
  }, [metrics]);

  return metrics && <div>{metrics.test1}</div>;
}

export default Results;
